                   direction[1] = oldDirX * sin(-rotSpeed) + direction[1] * cos(-rotSpeed);
                   oldPlaneX = camera[0];
                   camera[0] = camera[0] * cos(-rotSpeed) - camera[1] * sin(-rotSpeed);
